import React from 'react';
import Login from './login';
import Image from './image'

const FirstPage = () => {
    return (
        <React.Fragment>
            <div className='image-background'>
            <Image/>
            </div>
            <div className='form-container'>
            <Login/>
            </div>
            <div className='clear'></div>
        </React.Fragment>
     );
}
 
export default FirstPage;
